import React from 'react';
import {
  Nav,
  NavItem,
  NavLink,
} from 'reactstrap';
import { Link } from 'react-router-dom';

export default class NewDropdown extends React.Component {
  constructor(props){
    super(props);

    this.state = {

    }
  }

  refreshPage = (event) => {
    window.location.reload();
  }

  render(){
    return (
      <div className="NavDropdown-Component" id="navdropdown">
        { /* Whats inside the chid component in the parent component */ }
        <Nav>
          <NavItem className="Nav-Link">
            <Link to="/">
              <NavLink className="Navbar-Item" onClick={this.refreshPage}>Home</NavLink>
            </Link>

          </NavItem>
          <hr />

          <NavItem className="Nav-Link">
            <Link to="/signup">
              <NavLink className="Navbar-Item" onClick={this.refreshPage}>Communities</NavLink>
            </Link>
          </NavItem>

          <NavItem className="Nav-Link">
            <Link to="/login">
              <NavLink className="Navbar-Item" onClick={this.refreshPage}>Log in</NavLink>
            </Link>
          </NavItem>

          <NavItem className="Nav-Link">
            <Link to="/profile">
              <NavLink className="Navbar-Item" onClick={this.refreshPage}>Profile</NavLink>
            </Link>
          </NavItem>

          <NavItem className="Nav-Link">
            <Link to="/trades">
              <NavLink className="Navbar-Item" onClick={this.refreshPage}>Trades</NavLink>
            </Link>
          </NavItem>

          <NavItem className="Nav-Link">
            <Link to="/messages">
              <NavLink className="Navbar-Item" onClick={this.refreshPage}>Messages</NavLink>
            </Link>
          </NavItem>

          <NavItem className="Nav-Link">
            <Link to="/invite">
              <NavLink className="Navbar-Item" onClick={this.refreshPage}>Invite Friends</NavLink>
            </Link>
          </NavItem>

        </Nav>
        {/* props.children */}
      </div>

  );
}

}
